import React from 'react'

export const Profile = () => {
  return (
    <div class="intro">
        <div class="container">

            <p>I'm a multi-disiplinary frontend engineer with a passion for user-focused products. </p>
            <p>I'm a creative problem solver with a background in media production, photography, and marketing.</p>
            <p>I'm currently looking for <b>new opportunities</b>.</p>
            <a href="mailto: jaywen89@gmail.com"><button class="button"><span>Contact Me</span></button></a>
        </div>
  </div>
  )
}
